import React,{useState} from 'react';
import client from '../util/shopify-client'




const ItemList = () => {
    let itemList;

    itemList = client.product.fetchAll().then((products) => (
        products.map((item,i) => (
            <div key={i}>
                Hello there {item.description} 
            </div>
        ))
    ))
    return(
        <div>
            Ping ping <itemList />
        </div>
    )
}

const Products = () => {

    return(

        <div>
            Hello <ItemList />
        </div>
    )
}

const Store = () => {
    return(
        <div style={{
            position:"relative",
            top:"20vh"
        }}>
            Hello there and welcome
            <Products />
        </div>
    )
}

export default Store;
